import React, { useState } from "react";

function Card() {
  const [people, setPeople] = useState([
    {
      name: "Elon Musk",
      url: "",
    },
    {
      name: "Jeff Bezoz",
      url: "",
    },
  ]);
  return (
    <div className="card">
      {people.map((person) => (
        <h1>{person.name}</h1>
      ))}
    </div>
  );
}

export default Card;
